def entance(s, n, fruits):
    """"""
    fruit_counts = {}
    for fruit_info in s:
        (count, fruit) = fruit_info.split()
        fruit_counts[fruit] = int(count)
    remaining_fruits = n - sum(fruit_counts.values())
    result = {}
    for fruit in fruits:
        if fruit not in fruit_counts:
            if remaining_fruits > 0:
                result[fruit] = remaining_fruits
                remaining_fruits = 0
            else:
                break
    return result
